window.bookSummaryJSON = "<p><b>The Apocalypse is on its way to Earth.</b></p> <p>I don't have time to care. Ironic since I have the ability to stop time, I suppose.</p> <p>Having escaped capture by Ivicka and her dragon, I've barely had time to get used to my new class before the rules change again. Apparently, undead catgirls here can throw bolts of lightning and levitate chunks of earth the size of my mom's old Toyota. They're not even part of the official training dungeon!</p> <p>Still, who hasn't had to annihilate a few undead catgirls on occasion?</p> <p>As we'll soon discover, taking them down is only the first phase of surviving The Fallen City of Lescado.</p>"; 
